    is_increasing = True
    for i in range(1, n):
        if a[i] <= a[i-1]:
            is_increasing = False
            break

    # if it is not increasing, we can't obtain a strictly increasing sequence
    if not is_increasing:
        return "0\n"

    # otherwise, we can take the longest strictly increasing sequence we can obtain
    max_length = 0
    max_seq = ""
    for i in range(n):
        for j in range(i+1, n):
            # check if we can take the leftmost or rightmost element of the current subsequence
            if a[j] - a[i] == j - i:
                # we can take the leftmost element
                subseq = sorted(a[i:j+1])
                if len(subseq) > max_length:
                    max_length = len(subseq)
                    max_seq = ''.join(['L' for _ in subseq])
            if a[j] - a[i] == j - i + 1:
                # we can take the rightmost element
                subseq = sorted(a[i:j+1], reverse=True)
                if len(subseq) > max_length:
                    max_length = len(subseq)
                    max_seq = ''.join(['R' for _ in subseq])

    return f"{max_length}\n{max_seq}\n"

