    def invert_col(a, j):
        return [[c[j] for j in range(m) if j!= i][::-1] for i, c in enumerate(a)]

    if not is_sorted(a):
        return "NO\n"

    # BFS to find the sorting sequence
    def bfs(a):
        queue = [(a, "", "")]
        visited = set()
        while queue:
            (a, r, c) = queue.pop(0)
            if is_sorted(a):
                return (r, c)
            for i in range(n):
                for j in range(m):
                    if (i, j) not in visited:
                        if a[i][j] == 0:
                            b = invert_row(a, i)
                            new_r = r + "1"
                        else:
                            b = invert_col(a, j)
                            new_c = c + "1"
                        if str(b) not in visited:
                            queue.append((b, new_r, new_c))
                            visited.add(str(b))
        return None

    r, c = bfs(a)
    return "YES\n" + r + "\n" + c + "\n"

