    # dijkstra's algorithm
    dist = {}
    for i in range(1, n+1):
        dist[i] = float('inf')
    dist[1] = 0
    queue = [1]
    while queue:
        u = queue.pop(0)
        for v, w in graph[u].items():
            if dist[u] + w < dist[v]:
                dist[v] = dist[u] + w
                queue.append(v)

    # get kth smallest shortest path
    kth_shortest_path = sorted([dist[i] for i in range(1, n+1)])[k-1]

