    if k >= n:
        return s
    # count the frequency of each character in s
    freq = [0] * 2
    for c in s:
        freq[int(c)] += 1
    # iterate over all possible states and find the lexicographically smallest one
    ans = s
    for i in range(1, n):
        for j in range(i):
            if k == 0:
                break
            # swap s[i] and s[j]
            new_s = list(ans)
            new_s[i], new_s[j] = new_s[j], new_s[i]
            # update the frequency of each character
            for c in new_s:
                freq[int(c)] += 1
            # check if the frequency is less than or equal to k
            if all(f <= k for f in freq):
                # update the answer if this state is lexicographically smaller
                ans = ''.join(new_s)
            # undo the swap
            for c in new_s:
                freq[int(c)] -= 1
            k -= 1
    return ans

