def solution(stdin: str) -> str:
    lines = stdin.strip().split('\n')
    grid = [[int(x) for x in line.split()] for line in lines[:4]]
    move = int(lines[4])

    def merge(row):
        new_row = []
        for i in range(4):
            if i == 0 or grid[row][i]!= grid[row][i-1]:
                new_row.append(grid[row][i])
            else:
                new_row[-1] *= 2
                if new_row[-1] > 2048:
                    new_row[-1] = 2048
                if i < 3 and grid[row][i+1]!= 0:
                    new_row.append(grid[row][i+1])
                else:
                    new_row.append(0)
        return new_row

    def slide(grid, direction):
        if direction == 0:
            return [[merge(row)[col] for col in range(4)] for row in range(4)]
        elif direction == 1:
            return [[grid[col][row] for col in range(4)] for row in range(4)]
        elif direction == 2:
            return [[merge(row)[3-col] for col in range(4)] for row in range(4)]
        elif direction == 3:
            return [[grid[3-col][row] for col in range(4)] for row in range(4)]

    new_grid = slide(grid, move)

    result = []
    for row in new_grid:
        result.append(' '.join(str(x) for x in row))
    return '\n'.join(result)

