    # Parse input
    M, N = map(int, stdin.split()[0:2])
    vault = [[int(x) for x in stdin.split()] for _ in range(M)]

    # Define directions
    directions = ((0, -1), (-1, 0), (0, 1), (1, 0))

    # Define bfs search
    def bfs(start, end):
        # Initialize queue and visited set
        queue = [(start, 0)]
        visited = set()

        # Perform bfs search
        while queue:
            node, dist = queue.pop(0)

            if node == end:
                return dist

            # Add neighboring nodes to queue
            for dx, dy in directions:
                x2, y2 = node[0] + dx, node[1] + dy
                if 0 <= x2 < M and 0 <= y2 < N and vault[x2][y2] > vault[node[0]][node[1]]:
                    if (x2, y2) not in visited:
                        visited.add((x2, y2))
                        queue.append(((x2, y2), dist + 1))

        # No path found
        return -1

    # Find shortest path
    min_length = 1e9
    for x in range(M):
        for y in range(N):
            # Check if coin at (x,y) is special
            if vault[x][y] == vault[M-1][N-1]:
                # Perform bfs search from (x,y) to north-west corner
                north_west = bfs((x, y), (0, 0))
                # Perform bfs search from (x,y) to south-east corner
                south_east = bfs((x, y), (M-1, N-1))
                # Update min_length if applicable
                if north_west!= -1 and south_east!= -1:
                    min_length = min(min_length, north_west + south_east)

    # Output result
    if min_length == 1e9:
        return "No solution found"
    else:
        return str(min_length)

