    for i in range(n):
        for j in range(n):
            if i!= j and distances[i][j]!= 0:
                adj_list[i].append((j, distances[i][j]))

    # perform DFS to find minimum spanning tree
    visited = [False] * n
    parent = [-1] * n
    cost = [float('inf')] * n
    cost[0] = 0
    parent[0] = -1
    for i in range(n):
        if not visited[i]:
            stack = [i]
            while stack:
                u = stack.pop()
                if not visited[u]:
                    visited[u] = True
                    for v, w in adj_list[u]:
                        if cost[v] > cost[u] + w:
                            cost[v] = cost[u] + w
                            parent[v] = u
                            stack.append(v)

    # construct minimum spanning tree
    edges = []
    for i in range(1, n):
        edges.append((parent[i], i))

    # sort edges by weight
    edges.sort(key=lambda x: x[1])

    # output edges
    for u, v in edges:
        print(u+1, v+1)

