    i = 0
    j = 0
    for letter in key_phrase:
        if letter == 'Q':
            continue
        if letter == 'J':
            letter = 'I'
        if letter == 'Z':
            letter = 'S'
        key_table[i][j] = letter
        j += 1
        if j == 5:
            i += 1
            j = 0

    # fill remaining letters in key table
    for i in range(5):
        for j in range(5):
            if key_table[i][j] == '':
                key_table[i][j] = 'ABCDEFGHIKLMNOPQRSTUVWXYZ'[5*i+j]

    # encrypt message
    encrypted_text = ''
    i = 0
    j = 0
    for letter in plain_text:
        if letter =='':
            continue
        if letter == 'J':
            letter = 'I'
        if letter == 'Z':
            letter = 'S'
        if letter == 'X':
            encrypted_text += 'X'
            i = 0
            j = 0
            continue
        pair = letter + plain_text[i+1]
        if pair[0] == pair[1]:
            pair = pair[0] + 'X' + pair[1]
        if key_table[i][j] == pair[0]:
            encrypted_text += key_table[i][(j+1)%5]
            encrypted_text += key_table[i][(j-1)%5]
        elif key_table[i][j] == pair[1]:
            encrypted_text += key_table[(i+1)%5][j]
            encrypted_text += key_table[(i-1)%5][j]
